import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import  "./Navbar.css"

function Navbar() {
  const [linkStyle,setLinkStyle]=useState( {
        textDecoration: "none",
        color:"white",
        fontSize:25,
  })
  const changecolor=()=>{
    setLinkStyle( {
      textDecoration: "none",
      color:"grey",
      fontSize:25,
})
  }
  return (
    <div className='Nav'>
      <img src='/IMAGES/logo.png' width="82px"/>
      <ul>
        <li><Link   to="/" style={linkStyle} onMouseEnter={changecolor}>Home</Link></li>
        <li><Link to=""  style={linkStyle}>Categories</Link></li>
        <li><Link to=""  style={linkStyle}>About</Link></li>
        <li><Link to=""  style={linkStyle}>Contact</Link></li>
        <li><Link to=""  style={linkStyle}>Latest </Link></li>
      </ul>
        
    </div>
  )
}

export default Navbar
